import React, { useState, useEffect } from 'react';

const Profile = () => {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchUserProfile = async () => {
      try {
        const token = localStorage.getItem('token');
        const response = await fetch('http://localhost:5000/api/users/me', {
          headers: {
            'Authorization': `Bearer ${token}`
          }
        });
       
        if (response.ok) {
          const userData = await response.json();
          // Get movies count
          const moviesResponse = await fetch('http://localhost:5000/api/movies/count', {
            headers: {
              'Authorization': `Bearer ${token}`
            }
          });
          const moviesData = await moviesResponse.json();
          
          setUser({
            ...userData,
            moviesCount: moviesData.count,
            favoritesCount: userData.favorites?.length || 0
          });
        }
      } catch (error) {
        console.error('Error fetching profile:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchUserProfile();
  }, []);

  if (loading) {
    return (
      <div className="min-h-screen bg-gray-900 text-white flex items-center justify-center">
        <div className="text-xl">Loading profile...</div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-900 text-white p-8">
      <div className="container mx-auto max-w-2xl">
        <div className="bg-gray-800 rounded-lg shadow-xl p-8">
          <div className="flex items-center gap-8 mb-8">
            <img
              src={`https://ui-avatars.com/api/?name=${user?.name}&size=128&background=random`}
              alt="Profile"
              className="w-32 h-32 rounded-full"
            />
            <div>
              <h1 className="text-3xl font-bold mb-2">{user?.name}</h1>
              <p className="text-gray-400">Member since {new Date(user?.createdAt).toLocaleDateString()}</p>
            </div>
          </div>

          <div className="space-y-6">
            <div className="border-t border-gray-700 pt-6">
              <h2 className="text-xl font-semibold mb-4">Profile Information</h2>
              <div className="space-y-4">
                <div>
                  <label className="text-gray-400 block mb-1">Name</label>
                  <div className="text-lg">{user?.name}</div>
                </div>
                <div>
                  <label className="text-gray-400 block mb-1">Email</label>
                  <div className="text-lg">{user?.email}</div>
                </div>
              </div>
            </div>

            <div className="border-t border-gray-700 pt-6">
              <h2 className="text-xl font-semibold mb-4">Statistics</h2>
              <div className="grid grid-cols-2 gap-4">
                <div className="bg-gray-700 p-4 rounded-lg">
                  <div className="text-2xl font-bold">{user?.moviesCount || 0}</div>
                  <div className="text-gray-400">Movies Added</div>
                </div>
                <div className="bg-gray-700 p-4 rounded-lg">
                  <div className="text-2xl font-bold">{user?.favoritesCount || 0}</div>
                  <div className="text-gray-400">Favorites</div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
